import React from 'react'
import { TableHead } from './TableHead'
import {TableRow} from './TableRow'
import './Table.scss'

export const Table = () =>{

const theadData = ["No", "Email", "Date","Date","Date","Date","Date","Date" ];

const tbodyData = [
{
  id: "1", 
  items: [1, "john@email.com", "01/01/2021","Date","Date","Date","Date","Date"]
}, 
{
  id: "2", 
  items: [1, "sally@email.com", "12/24/2020","Date","Date","Date","Date","Date"]
},
{
  id: "3", 
  items: [1, "maria@email.com", "12/01/2020","Date","Date","Date","Date","Date"]
},



]
    return(

        <table className="main__table" cellspacing="0" >
            <thead className="main__table__heading">
                <tr className="main__table__heading__row">
                    {theadData.map(head=><TableHead key={head} item={head}></TableHead>)}
                </tr>
            </thead>
            <tbody className="main__table__body">
                {tbodyData.map((item)=><TableRow key={item.id} data={item.items}></TableRow>)}
            </tbody>

        </table>
    )
}
